import React, { useState } from 'react';
import { IonButton, IonLoading } from '@ionic/react';
import { useHistory } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { satrexGreen } from '../../styles/colors';
import Trans, { transFn } from '../../components/Trans';
import { cleanRedirects } from '../../redux/actions/LayoutActions';
import { getQualifyLevel } from '../../utils/apis';


const index: React.FC = () => {
  const history = useHistory();
  const dispatch = useDispatch();
  const [showLoading, setShowLoading] = useState(false);
  const handleRetry = async () => {
    setShowLoading(true);
    try {
      await getQualifyLevel();
      history.push('/home');
      setShowLoading(false);
    } catch (err) {
      setShowLoading(false);
    }
  };

  return (

    <div style={{
        width: '100%',
        height: '100%',
        justifyContent: 'center',
        alignItems: 'center',
        display: 'flex',
        flexDirection: 'column',
    }}>
      <img
        alt="noInternetImage"
        style={{ width: '80%' }}
        src="data:image/png;base64,"
      />
      <span style={{ fontSize: 25, color: satrexGreen, marginTop: 30 }}><Trans>Unable to communicate with server!</Trans></span>
      <IonButton
        className="sessionButton"
        style={{
          margin: 0, marginTop: 30, width: '50%', minWidth: 300,
        }}
        onClick={handleRetry}
      >
        <Trans>Retry</Trans>
      </IonButton>
      <IonLoading
        isOpen={showLoading}
        onDidDismiss={() => setShowLoading(false)}
        message={transFn('please wait...')}
        spinner="lines"
      />
    </div>
  );
};

export default index;
